import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import "./character_database.js";
import character_database from "./character_database.js";

let selected_characters = [1];

function App() {
  let character_one = character_database.find(
    element => element.id == selected_characters[0]
  );

  return (
    <div className="App">
      <label>Ally:{}</label>
      <img>{character_one.ability_one_image}</img>
      <img>{character_one.ability_two_image}</img>
      <img>{character_one.ability_three_image}</img>
      <img>{character_one.ability_four_image}</img>
      <label>Enemy:{}</label>
    </div>
  );
}

export default App;
